import React from 'react';
import {CustomButtonContainer } from './custom-button.styles'

const CustomButton = ({
  children,
  ...otherProps
}) => (
  <CoustomButtonContainer {...otherProps} >
    {children}
  </CoustomButtonContainer>
);

export default CustomButton;
